void NN::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"U0_V\" :  \"" << U0_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"U1_V\" :  \"" << U1_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"U2_V\" :  \"" << U2_V.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"Y0_V\" :  \"" << Y0_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"Y0_V_ap_vld\" :  \"" << Y0_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"Y1_V\" :  \"" << Y1_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"Y1_V_ap_vld\" :  \"" << Y1_V_ap_vld.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

